        if self.source is not None:
            AIS_FullAddSource(builder, source)
        if self.sourceDl is not None:
            AIS_FullAddSourceDl(builder, sourceDl)
        if self.origin is not None:
            AIS_FullAddOrigin(builder, origin)
        AIS_FullAddDataMode(builder, self.dataMode)
        if self.origNetwork is not None:
            AIS_FullAddOrigNetwork(builder, origNetwork)
        aisFull = AIS_FullEnd(builder)
        return aisFull
